const DefaultEditorSource = `import React, { Component } from "react";
import { Editor } from "react-draft-wysiwyg";

class DefaultEditor extends Component {
   render() {
      return <Editor editorClassName="demo-editor" />;
   }
}
export default DefaultEditor;
`;

export default DefaultEditorSource;
